import React from "react";
import "./card.css";
const Card = () => {
  return (
    <div className="content">
      <div className="topBanner"></div>
      <div className="profilePictureContainer">
        <div className="profilePicture"></div>
      </div>
      <div className="profileInfo"></div>
      <div className="profileStats"></div>
    </div>
  );
};

export default Card;
